DAILY_HOROSCOPE_WORDS41 = _t("有上进心是好事，但要切记不要好高骛远。坚持努力和加倍努力，到头来你会发现，你希望的事情水到渠成！")
DAILY_HOROSCOPE_WORDS42 = _t("未来或可迎来连环好运，之前因为某事展现的恒心和毅力有目共睹，临场爆发力更是备受期待。但要注意不要乐极生悲！")
