DAILY_HOROSCOPE_WORDS64 = _t("今天你会想起曾今受到的非议和不快乐，你要记住你的人生虽然留下了伤痕，但那时为了更好的成长，坚强起来吧！")
DAILY_HOROSCOPE_WORDS65 = _t("星矢说过，希望是任何时候都不能放弃的。这句话送给今天的你，要突破任何困难或是恶劣环境，然后产生希望！")
DAILY_HOROSCOPE_WORDS66 = _t("尽管伤痕是男子汉的勋章，但你的家人却愿意用他们的生命换取你的健康。不要再犹豫了，珍惜身边人就是你今天的开运秘诀。")
