DAILY_HOROSCOPE_WORDS68 = _t("紫龙是个任何时刻都相信奇迹，并且为了等待这个奇迹而不懈努力的人。今天的你不要轻言放弃，也许奇迹就在下一秒。")
DAILY_HOROSCOPE_WORDS69 = _t("哪怕地狱之门背后的道路充满荆棘和苦难，瞬依然能够保留她的慈悲。在任何时候坚守原则，是你今天要谨记的重要法则。")
DAILY_HOROSCOPE_WORDS70 = _t("今天的你要学习凤凰座一辉的决断力，别因为那些莫名的担忧变得犹犹豫豫。千万不要等到机会溜走了再去后悔！")
DAILY_HOROSCOPE_WORDS71 = _t("今天的你，需要重拾友谊的力量。或许你会觉得这世界上真的没有什么可以相信，但你抛弃了友谊和眼泪，就毫无胜利的希望了。")
DAILY_HOROSCOPE_WORDS72 = _t("今天的你会觉得每一天都是过去的重复。不过圣斗士紫龙让我转告你，奋战通常需要付出代价，这并不是为了眼前，而是为了未来。")
DAILY_HOROSCOPE_WORDS73 = _t("今天的你不要太较真了。要知道这宇宙的真理就是无常，没有所谓完全的罪恶，也没有所谓完全的正义。不要让自己显得矫枉过正")
DAILY_HOROSCOPE_WORDS74 = _t("今天的你要谨记，梦不一定是指不可能。开始发觉梦想是不可能实现的你，已经走到了人生的终点。请让你的小宇宙燃烧吧！")
DAILY_HOROSCOPE_WORDS75 = _t("适当的慈悲并不是坏事，奉献爱心是你今天开运指南。许多人从童虎身上明白，生命是只有一次的，正因如此它才会散发无比宝贵的光芒。")
DAILY_HOROSCOPE_WORDS76 = _t("珍惜时间是你今天必须要做的，也许你会觉得什么都没有意义。但你要明白，建立人类今天的文明，饱含了无数牺牲和付出。")
